import React from "react";
import MusicSearch from "./MusicSearch"
import MusicPage from "./MusicPage"

function handleMusicListings({musicInfo}){

    return (
        <main>
            <MusicSearch/>
            <MusicPage musicInfo={musicInfo}/>
        </main>
    )

}

export default handleMusicListings;
